        <div className="h-screen">
            <div class="snap-x snap-mandatory overflow-x-auto flex">
                <div class="snap-center w-64 h-64 bg-blue-200">Элемент 1</div>
                <div class="snap-center w-64 h-64 bg-green-200">Элемент 2</div>
                <div class="snap-center w-64 h-64 bg-red-200">Элемент 3</div>
            </div>
        </div>
    );
};

export default Counter;
